The Community College science fair is one of the most anticipated event in the calendar for some of the brainier undergrads. And among them is the hot and busty Alexis Monroe, though her project does little to impress professor Sins. After calling her out on her bullshit presentation, she finally gets to the point of her research... The potency of male sexual arousal.
